            method:'GET',
        })
        const res = await data.json()
        if(res.status==="Success"){
          setPost(res.post)
        }
        console.log(res.post)
        // setPost
    }

    getAllPosts()
        
  }, []);

  return (
    <div>
      <h1>{Post.map((data)=>{
        return <p>
          {data.title}
        </p>
      })}</h1>
    </div>
  );
}
